import EmployersListItem from "../employers-list-item/employers-list-item";

import './employers-list.css';

const EmployersList = () => {
    return (
        <ul className="app-list list-group">
            <EmployersListItem name="John Smith" salary={900} />
            <EmployersListItem name="Adam Evan" salary={8500} />
            <EmployersListItem name="Азат Абраров" salary={80} />
        </ul>
    )
}

export default EmployersList;
